import React from 'react';
import ReactDOM from 'react-dom';
import sum,{sub , mult , div} from './App';
// import Heading from './Heading';
// import List from './List';
import App from './App';

function Card(){
    return(
        <>
            <div className="cards">
            <div className="card">
            <img src="" alt="myPic" className="card_img"/>
            <div className="card_info">
            <span></span>
            </div>
            </div>
            </div>
        </>
    );
}
ReactDOM.render(<App/>,
